import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import './index.css';


class App extends Component {
    render() {
        return (
            <div>Hey From React!!</div>
        )
    }
}

ReactDOM.render(<App />, document.getElementById('root'));
